import gymapp from "../images/Gym-app.mp4";
import EV from "../images/EV_Site.mp4";
import forum from "../images/forum (1).mp4";
export const Data=[
    {
        name:"Gym-App",
        video:<source src={gymapp} type="video/mp4" />,
        desc:" Gym app A Best, user can join the gym through the this web site just fill the form and also send the mail .This web  site is available on the "
        
    },
    {
        name:"E-commerce",
        video:<source src={EV} type="video/mp4" />,
        desc:" This is E-commerce layout website motivated by the Electric vehile also making awesome design and the data fatch and insert through the MYSQL database "
        
    },
    {
        name:"Forum",
        video:<source src={forum} type="video/mp4" />,
        desc:" This is discussion website which are used for problem solving and secure data store in the DATABASE with all operation CRUD(create , Read , Update, Delete)"
    }
]
